When we declare variables, what we are actually doing is we are declaring auto variables, its default behaviour. int a is the same as auto int a. What auto means is that, "delete this variable from memory as soon as it goes out of scope". This is what gives the variables a local nature by default. If you place they keyword static in place of auto, you enter a totally different game. The word static means stationary, referring to no movement, and thats exactly what happens to variables when we declare them static. static variables are not deleted from the memory when they go out of scope. This is the key to the concept of a static variable—it does not come and go as the function is called and returns. This implies that the value a static variable has upon leaving a function is the same value that variable will have the next time the function is called. Static variables are removed from the memory only when the entire program ends. Its life cycle is the same as that of the entire program. Static variables also differ with respect to their initialization. A static, local variable is initialized only once at the start of overall program execution—and not each time that the function is called. Furthermore, the initial value specified for a static variable must be a simple constant or constant expression. Static variables also have default initial values of zero, unlike automatic variables, which have no default initial value. Let's look at an example #include <stdio.h> void static_add(){ static int a = 1; printf("%i\n", a); ++a;
} void add(){ int a = 1; printf("%i\n", a); ++a;
} int main(){ printf("Running add()\n"); for(int i=0; i<5; i++){ add(); } printf("Running static_add()\n"); for(int i=0; i<5; i++){ static_add(); } return 0;
} The output will be $ ./a.out
